#!/bin/bash
#30-3-2017 MRC-Epid JHZ

rt=/gen_omics/data/EPIC-Norfolk/HRC/raw/EPIC-Norfolk
rt2=/scratch/tempjhz22/23-1-17
awk '{if(NR>1) $1=$2;print}' $rt.sample > $rt2/EPIC-Norfolk.sample

# 20932
# conversion of bgen to vcf
qctool=/genetics/data/software/bin/qctool
cd /scratch/tempjhz22/23-1-17/HRC
for chr in $(seq 22);do sge "$qctool \
 -g $rt.chr${chr}.bgen \
 -s $rt2/EPIC-Norfolk.sample \
 -incl-samples $rt2/EPIC-Norfolk.inc \
 -og $rt2/HRC/EPIC-Norfolk.chr${chr}.vcf.gz \
 -assume-chromosome ${chr} \
 -log $rt2/HRC/EPIC-Norfolk.chr${chr}.log"
done

rt=/genetics/data/gwas/23-1-17/bin
rt2=/scratch/tempjhz22/23-1-17/HRC
bgzip=$rt/bgzip
tabix=$rt/tabix
cd $rt2
for i in $(seq 22);do sge "/genetics/data/gwas/23-1-17/st.subs $i $rt2;$tabix -f -p vcf $rt2/${i}.vcf.gz"; done

# 21044
rt=/genetics/data/gwas/23-1-17
rt2=/scratch/tempjhz22/23-1-17/HRC/log
for i in $(seq 22);do cd $rt2;sge "$rt/HRC_st.v4.2 $i";done

